import logo from './platzi.webp';
import './App.css';

function App() {
  return (
    <div className="App">
      <TodoCount
      completed={3}
      total={4}/>

      <TodoSearch/>
      <TodoList>
        <TodoItem/>
        <TodoItem/>
        <TodoItem/>
      </TodoList>

      <CreateTodoButtom/>

    </div>
  );
}

function TodoCount(props){
  return(
    <h1>
      completaste {props.completed} de {props.total} TODOs
    </h1>
  )
}

function TodoItem() {
  return (
    <li>
      <span>V</span>
      <p>Llorar con la llorona</p>
      <span>X</span>
    </li>
  );
}

export default App;
